class Person{constructor(e,t,r,n){this.name=e,this.adress=t,this.id=r.toString(),this.age=n.toString()}changeId(e){this.id=e.toString()}displayFullInfo(){console.log("Imię: "+this.name+", Adres: "+this.adress+", Id: "+this.id+", Wiek: "+this.age+", Rola: "+this.role)}}class Student extends Person{constructor(e,t,r,n){super(e,t,r,n),this.role="student"}}class Teacher extends Person{constructor(e,t,r,n){super(e,t,r,n),this.role="nauczyciel"}}const StudentsArray=[new Student("Kamila","Gdansk",2302,21),new Student("Ania","Gdynia",3445,22),new Student("Jagoda","Sopot",2125,23),new Student("Martyna","Wejherowo",9885,20)],TeachersArray=[new Teacher("Andrzej","Warszawa",3403,34),new Teacher("Tomek","Kraków",6421,45),new Teacher("Michał","Wrocław",9821,29),new Teacher("Maciek","Poznań",4421,35)];class Render{static renderText(e,t){const r=document.querySelector(t);let n="";e.map(e=>{n+=`<div><div>${e.name}</div><div>${e.adress}</div><div>${e.id}</div><div>${e.age}</div><div>${e.role}</div></div>`}),r.innerHTML=n}}Render.renderText(StudentsArray,"#students"),Render.renderText(TeachersArray,"#teachers");